import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import ISBARApplicationSimple from './ISBARApplicationSimple';
import reportWebVitals from './reportWebVitals';
import { oauth2 as SMART } from "fhirclient";

//var fhirClient;
SMART.init({
  clientId: "ISBAR-app",
  scope: "launch openid fhirUser patient/*.read patient/*.write",
  redirectUri: "index.html"
})
  .then(client => {
    fhirClient = client;
    return Promise.all([
      client.patient.read(),
      // get questionnaire
      client.request('Questionnaire?name=ISBARSimple'),
      // get questionnaire response
      client.request('QuestionnaireResponse?patient=${client.patient.id}&name=ISBARSimpleResponse')
    ])
  }).then( (patient, questionnaire, questionnaireResponse) => {
    console.log(patient);
    console.log(questionnaire);
    console.log(questionnaireResponse);
    // handle the request
  })

ReactDOM.render(
  <React.StrictMode>
    <ISBARApplicationSimple />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
